syntax = "proto3";
option java_package = "emu.grasscutter.net.proto";
// 4.7.0
// Obf: CEIPLLACIIJ
message GivingRecord {
	uint32 config_id = 2;
	bool is_gadget_giving = 3;
	uint32 last_group_id = 10;
	uint32 giving_id = 5;
	bool is_finished = 8;
	map<uint32, uint32> material_cnt_map = 7;
	uint32 group_id = 9;
}
